pragma solidity 0.5.12;

interface IPrivateCompany {event __CoverageIPrivateCompany(string fileName, uint256 lineNumber);
event __FunctionCoverageIPrivateCompany(string fileName, uint256 fnId);
event __StatementCoverageIPrivateCompany(string fileName, uint256 statementId);
event __BranchCoverageIPrivateCompany(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoverageIPrivateCompany(string fileName, uint256 branchId);
event __AssertPostCoverageIPrivateCompany(string fileName, uint256 branchId);

    function totalSupply() external      returns (uint256);

    function balanceOf(address account) external      returns (uint256);

    function transfer(address recipient, uint256 amount) external returns (bool);

    function allowance(address owner, address spender) external      returns (uint256);

    function approve(address spender, uint256 amount) external returns (bool);

    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);

    function increaseAllowance(address spender, uint256 addedValue) external returns (bool); 

    function decreaseAllowance(address spender, uint256 subtractedValue) external returns (bool);

    function name() external      returns (string memory);

    function symbol() external      returns (string memory);    

    function decimals() external      returns (uint8); 

    function owner() external      returns (address);

    function isOwner() external      returns (bool);

    //onlyOwner
    function renounceOwnership() external;

    //onlyOwner
    function transferOwnership(address newOwner) external;

    //onlyOwner
    function mint(uint256 amount) external;

}
